import Destination from "../components/Destination";
import Navbar from "../components/Navbar";
import Hero from "../components/Hero";
import Bestsell from "../components/Bestsell";
import Footer from "../components/Footer";
import '../routes/Service';

function Home (){
    return(
        <>
        <Navbar/>
        <Hero
            cName="hero"
            heroImg="https://scontent.fcmb8-1.fna.fbcdn.net/v/t1.6435-9/68476057_3184404218237190_530933600749617152_n.jpg?_nc_cat=102&ccb=1-7&_nc_sid=5f2048&_nc_ohc=EW5m2Arob1MAX9HC3SO&_nc_ht=scontent.fcmb8-1.fna&oh=00_AfDRyj91SdYx5CzShB208cy8yjTPpN-l6wiDuSYDkkSmAw&oe=661D2EFE"
            title="Order your jewelery"
            buttonText="Order Now"
            url='../routes/Service.js'
            btnClass="show"
        />

        <Destination/>
        <Bestsell/>
        <Footer/>
        </>
    )
}

export default Home;
